import { useEffect, useState } from "react";
function Effect() {
    //useEffect(callback, [deps])
    // 
    const [title, setTitle] = useState('');
    useEffect(() => {
        document.title = title;

    })
    return (
        <>
            <input value={title} onChange={e => setTitle(e.target.value)} />
        </>
    )
}
export default Effect;
